import React from 'react'
import Header from './Header'
import { useState, useEffect } from 'react'

function Users() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);

    const [name, setName] = useState('');
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [address, setAddress] = useState('');
    const [phone, setPhone] = useState('');
    const [company, setCompany] = useState('');
    const [website, setWebsite] = useState('');

    useEffect(() => {
        fetch("http://localhost:3005/users")
            .then(res => res.json())
            .then(
                (result) => {
                    setIsLoaded(true);
                    setItems(result);
                },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )
    }, [])
    const submitHandler=(e)=>{
        console.log("name",name)
        console.log("username",username)
        console.log("email",email)
        console.log("address",address)
        console.log("phone",phone)
        console.log("company",company)
        console.log("website",website)
        e.preventDefault()
    }

    if (error) {
        return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
        return <div>Loading...</div>;
    } else {
        return (
            <>
                <Header />
                <div style={{textAlign:'center'}}>
                    <form onSubmit={submitHandler}>
                        <label for="Name">Enter Name:</label><br />
                        <input type="text" onChange={(e)=>setName(e.target.value)} id="Name" name="Name"/><br />
                        <label for="Username">Enter Username:</label><br />
                        <input type="text" onChange={(e)=>setUsername(e.target.value)} id="Username" name="Username"/><br />
                        <label for="Email">Enter Email:</label><br />
                        <input type="email" onChange={(e)=>setEmail(e.target.value)} id="Email" name="Email"/><br />
                        <label for="Address">Enter Address:</label><br />
                        <input type="text" onChange={(e)=>setAddress(e.target.value)} id="Address" name="Address"/><br />
                        <label for="Phone">Enter Phone:</label><br />
                        <input type="text" onChange={(e)=>setPhone(e.target.value)} id="Phone" name="Phone"/><br />
                        <label for="Website">Enter Website:</label><br />
                        <input type="text" onChange={(e)=>setC(e.target.value)} id="Website" name="Website"/><br />
                        <label for="Company">Enter Company:</label><br />
                        <input type="text" onChange={(e)=>setTitle(e.target.value)} id="Company" name="Company"/><br />
                        <button type="submit">Submit</button>
                    </form>
                </div>
                <ul>
                    {items.map(item => (
                        <li key={item.id}>{item.id}
                            <ul>
                                <li>Name: {item.name}</li>
                                <li>Email: {item.email}</li>
                                <li>Username: {item.username}</li>
                                Address:
                                <ul>
                                    <li>street : {item.address.street}</li>
                                    <li>suite : {item.address.suite}</li>
                                    <li>city : {item.address.city}</li>
                                    <li>zipcode : {item.address.zipcode}</li>
                                    Geo:
                                    <ul>
                                        <li>lat : {item.address.geo.lat}</li>
                                        <li>lng : {item.address.geo.lng}</li>
                                    </ul>
                                </ul>
                                <li>phone: {item.phone}</li>
                                <li>website: {item.website}</li>
                                company:
                                <ul>
                                    <li>name : {item.company.name}</li>
                                    <li>catchPhrase : {item.company.catchPhrase}</li>
                                    <li>bs : {item.company.bs}</li>
                                </ul>
                            </ul>
                        </li>
                    ))}
                </ul>
            </>
        );
    }
}
export default Users
